import './App.css';
import Intro from './Intro';
import Brands from './Brands.js'

import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import NewArrivals from './NewArrivals.js'
import Sales from './Sales.js';
import firstGirl from '../images/favouritePic1.png'
import secondGirl from '../images/favouritePic2.png'

// import favourite from '../images/favourite.png'
function App() {
  return (
    <Router>
      <Intro></Intro>
      <Brands/>
      <NewArrivals/>
      <Sales/>
      <div id='favourite'>
        <div>
          <img alt="" src={firstGirl}></img>
          <img alt="" src={secondGirl}></img>
        </div>
      </div>
      <Routes>
        <Route path="/catalog" element={<h2>Catalog Page</h2>} />
      </Routes>
    </Router>

  );
}

export default App;
